text:
@ThonyPLT Bonjour Anthony ! Merci pour votre #CastCompliment pour ma collègue Miranda, elle est ravie de lire votre message et d'avoir pu vous aider ! 
À bientôt,
Dario ºoº

@Blaadr Bonjour Adrien!
Effectivement, vous pouvez également demander votre compensation via le formulaire de contact disponible ici : [LIEN] ou par e-mail en écrivant à dlp.guestcomm.fr@disneylandparis.com . Nous reviendrons vers vous au plus vite.
Miranda ºoº

@JessMayon Bonjour Jessica,

En raison de problèmes techniques, certaines de nos attractions sont temporairement fermées. Nous mettons tout en œuvre pour assurer un retour à la normale dans les plus brefs délais. Nous vous prions de bien vouloir nous excuser pour la gêne occasionnée. 

Lexi

@unejoyeuseee Bonjour! Nos chers Super Héros sont très occupés en ce moment avec une mission spéciale et super secrète pour sauver le monde! Ils reviendront dans le Parc Walt Disney Studios l'année prochaine, pendant le printemps. 
À bientôt pour une aventure extraordinaire ! 💥
Miranda ºoº

@pyanfar1981 Bonjour, vous pouvez trouver les tarifs des billets vendus aux guichets de billetterie situés aux entrées de nos Parcs Disney sur notre site web officiel 👉 [LIEN] .
À bientôt !
Miranda ºoº

@adrien_disney Hey Adrien! C'est un plaisir de lire que vous avez osé franchir les portes du Hollywood Tower Hotel et vivre de nouvelles aventures frissonnantes! Votre #CastCompliment sera partagé avec Martin, Raven, Jordan, Cedric et le reste des bellhops ⚡🛎.
Oserez-vous revenir?
Miranda ºoº
